import React from 'react';
import styled from "styled-components";

const Input = styled.input`
  padding: 0.5em;
  margin: 0.5em;
  color: ${(props) => props.inputColor || "red"};
  background: papayawhip;
  border: none;
  border-radius: 3px;
`;

const MyPage = () => {
  return (
    <div>
      <div>나의마켓</div>
      <div>설정</div>
    </div>
  );
};

export default MyPage;
